var facilityTypes = [];

// Start the Data Replication Sync
myApp.syncFacilities = function (customername, username, password) {
    syncMessage = document.getElementById("syncMessage");
    
    if (syncMessage == null){
        syncMessage = {};
    }
    
    if (!hasNetwork()) {
        syncMessage.innerHTML = "Device is currently offline. Sync not attempted.";
        
        return;
    }

    if (typeof cordova === 'undefined') {
        syncMessage.innerHTML = "Sync requires Cordova. Sync not attempted.";
        return;
    }

    syncMessage.innerHTML = "Syncing facilities list...";
    myApp.syncingFacilities(true);
    MEAData.agent(username, function (agent) {
        console.log("Agent created.");
        // Register the agent
        config.registree = username;
        config.user = username;
        config.password = password;
        config.url = buildDataReplicationURL();
        drAgent = agent;
        agent.register(config, function (name) {
            console.log("Agent registered.");
            // Get a cache
            agent.cache(config.name, function (cache) {
                console.log("Cache obtained.");
                syncMessage.innerHTML = "\nSyncing...";
                drCache = cache;
                // Sync the cache
                cache.sync(function (response) {
                    console.log("Cache synced.");
                    syncMessage.innerHTML = "\nData synced.";
                    // Get the database
                    cache.openAsDatabase(function (db) {
                        console.log("Database filename obtained.");
                        drDb = db;
                        // Start a transaction
                        db.transaction(function (tx) {
                            console.log("Database transaction obtained.");
                            // Query the database
                            tx.executeSql(sqlQuery, [], function (tx, res) {
                                console.log("Database query returned...");
                                syncMessage.innerHTML = "\nThere are " + res.rows.length + " facilities.";
                                drTotalFacilities = res.rows.length;
                                drResult = res;
                                myApp.getFacilityTypes();
                                myApp.searchFacilities();
                                myApp.syncingFacilities(false);
                            }, function (tx, error) {
                                // executeSql Error
                                console.error(error.message);
                                syncMessage.innerHTML = "\nError: " + error.message;
                                myApp.syncingFacilities(false);
                            });
                        }, function (error) {
                            // transaction Error
                            console.error(error);
                            syncMessage.innerHTML = "\nError: " + error;
                            myApp.syncingFacilities(false);
                        });
                    }, function (errorMessage) {
                        // openAsDatabase Error
                        console.error(errorMessage);
                        syncMessage.innerHTML = "\nError: " + errorMessage;
                        myApp.syncingFacilities(false);
                    });
                },
                function (errorMessage) {
                    // sync Error
                    console.error(errorMessage);
                    syncMessage.innerHTML = "\nError: " + errorMessage;
                    myApp.syncingFacilities(false);
                });
            }, function (errorMessage) {
                // cache Error
                console.error(errorMessage);
                syncMessage.innerHTML = "\nError: " + errorMessage;
                myApp.syncingFacilities(false);
            });
        }, function (errorMessage) {
            // register Error
            console.error(errorMessage);
            syncMessage.innerHTML = "\nError: " + errorMessage;
            myApp.syncingFacilities(false);
        });
    }, function (errorMessage) {
        // agent Error
        console.error(errorMessage);
        syncMessage.innerHTML = "\nError: " + errorMessage;
        myApp.syncingFacilities(false);
    });

}

