myApp.syncingFacilities = function (syncing) {
    if (syncing) {
        $$('#availableFacilitiesTitle i').addClass('ion-refreshing');
        $$('#availableFacilitiesTitle i').removeClass('ion-refresh');
    }
    else {
        $$('#availableFacilitiesTitle i').removeClass('ion-refreshing');
        $$('#availableFacilitiesTitle i').addClass('ion-refresh');
    }
}

myApp.searchFacilities = function () {
    var types = [];
    var sqlSearch;
    var nameValue;
    var typeValues = [];

    syncMessage = document.getElementById("syncMessage");
    nameValue = $$('#searchFacilityName').val();

    syncMessage.innerHTML = "Updating facilities list...";

    if (typeof drDb !== 'undefined') {
        // Start a transaction
        drDb.transaction(function (tx) {

            if (nameValue.length > 0) {
                sqlSearch = "SELECT * FROM facility WHERE name LIKE '%" + nameValue + "%';";
            }
            else {
                sqlSearch = "SELECT * FROM facility;";
            }
            if (typeValues.length > 0) {

                if (nameValue.length > 0) {
                    sqlSearch += " AND (";
                }
                else {
                    sqlSearch += " (";
                }

                var sqlTypes = "";
                for (var i = 0; i < typeValues.length; i++) {
                    if (typeValues[i].checked) {
                        if (sqlTypes !== "") {
                            sqlTypes += " OR ";
                        }
                        sqlTypes += " type = '" + typeValues[i].name + "'";
                    }
                }

                sqlSearch += sqlTypes + ")";
            }
            tx.executeSql(sqlSearch, [], function (tx, res) {
                myApp.displayFacilities(res);
            }, function (tx, error) {
            });
        }, function (error) {
        });
    }
}

myApp.displayFacilities = function (res) {
    var template = $$('#templateListFacility').html();

    syncMessage = document.getElementById("syncMessage");

    // compile it with Template7
    var compiledTemplate = Template7.compile(template);

    // Now we may render our compiled template by passing required context
    var context = {
    };

    context.rows = [];

    for (var i = 0; i < res.rows.length; i++) {
        var row = {};
        var facType = "";
        for (var j = 0; j < facilityTypes.length; j++){
            if (facilityTypes[j].id == res.rows.item(i).type) {
                facType = facilityTypes[j].name;
                break;
            }
        }

        row.facilityID = res.rows.item(i).facilityID;
        row.name = res.rows.item(i).name;
        row.type = facType;
        row.phone = res.rows.item(i).phone;
        row.location = res.rows.item(i).city + ", " + res.rows.item(i).state;
        row.description = res.rows.item(i).description;
        row.contact = res.rows.item(i).contact;
        //row.inspections = myApp.getFacilityInspections(row.facilityID);

        context.rows.push(row);
    }

    var html = compiledTemplate(context);
    myApp.updateFacilitiesList(res.rows.length, drTotalFacilities);

    // document.getElementById("availableFacilitiesList").inne rHTML = html;
    var el = document.getElementById("availableFacilitiesList");
    el = replaceHtml(el, html);

    myApp.destroySearchbar('.searchbar');
    myApp.initSearchbar('.searchbar');
}

myApp.displayFacilitiesJSON = function (json) {
    var facilitiesJSON = json;
    var template = $$('#templateListFacility').html();

    drTotalFacilities = json.length;
    syncMessage = document.getElementById("syncMessage");

    // compile it with Template7
    var compiledTemplate = Template7.compile(template);

    // Now we may render our compiled template by passing required context
    var context = {
    };

    context.rows = [];

    for (var i = 0; i < facilitiesJSON.length; i++) {
        var facJSON = JSON.parse(facilitiesJSON[i]);
        var row = {};
        var facType = "";
        for (var j = 0; j < facilityTypes.length; j++) {
            if (facilityTypes[j].id == facJSON.type) {
                facType = facilityTypes[j].name;
                break;
            }
        }

        row.facilityID = facJSON.facilityID;
        row.name = facJSON.name;
        row.type = facType;
        row.phone = facJSON.phone;
        row.location = facJSON.city + ", " + facJSON.state;
        row.description = facJSON.description;
        row.contact = facJSON.contact;
        //row.inspections = myApp.getFacilityInspections(row.facilityID);

        context.rows.push(row);
    }

    var html = compiledTemplate(context);
    myApp.updateFacilitiesList(facilitiesJSON.length, drTotalFacilities);

    // document.getElementById("availableFacilitiesList").inne rHTML = html;
    var el = document.getElementById("availableFacilitiesList");
    el = replaceHtml(el, html);

    myApp.destroySearchbar('.searchbar');
    myApp.initSearchbar('.searchbar');
}

myApp.updateFacilitiesList = function (facNum, facTotal) {
    if (facNum == 1) {
        syncMessage.innerHTML = "Found 1 facility from a total of " + facTotal + " facilities";
    }
    else if (facNum > 1) {
        syncMessage.innerHTML = "Found " + facNum + " facilities from a total of " + facTotal + " facilities";
    }
    else {
        syncMessage.innerHTML = "Found 0 facilities matching the search criteria";
    }
}

